import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div>
      <h1>Welcome to Student-Teacher Portal</h1>
      <Link to="/student">Student</Link>
      <br />
      <Link to="/teacher">Teacher</Link>
    </div>
  );
}

export default Home;
